Matter here for sentencing.  Parties indicated no corrections in the PSI.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by: Leah R.  AS TO COUNT #1:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be NINE (9) years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for FOUR (4) years with credit for  TWO HUNDRED TWENTY-EIGHT (228) days time served.  Defendant shall serve FIVE (5) years on EXTENDED SUPERVISION.  

The defendant is not eligible for the Challenge Incarceration Program;
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Random urine screens to ensure compliance;
 - No contact with the victim, KLR, or the victim's family, and that includes going through social media to contact the victim or her family;
 - Cooperate and participate with SEX OFFENDER EVALUATION and any recommended treatment;
 - Restitution in the amount of $5,680.25 with the following break-down:  $1,609.34 to Crime Victim Compensation; and $4,070.91 to Leah R.
 - Pay the DNA surcharge, costs and disbursements.  Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  Failure to pay the balance while on extended supervision will convert to a civil judgment. 

Matter is set for continued sentencing on August 17, 2016 at 10:00am so that the Court can advise the Defendant of the Sex Registry Warnings.  

